// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {ListBusinessPost} from "../../../database/business/post/ListBusinessPost.sol";

abstract contract ListBusinessPostCursor {
    ListBusinessPost private listBusinessPostCursor;

    constructor(address value) {
        listBusinessPostCursor = ListBusinessPost(value);
    }

    modifier onlyIdBelongstoBusinessId(uint256 id, uint256 businessId) {
        require(
            _checkIdBelongstoBusinessId(id, businessId),
            "List Business Post Cursor: post id not belongs to business id"
        );
        _;
    }

    function _checkIdBelongstoBusinessId(uint256 id, uint256 businessId)
        public
        view
        returns (bool)
    {
        uint256 validateId = listBusinessPostCursor.at(id).businessId;
        if (validateId == businessId) return true;
        return false;
    }

    function _getListBusinessPostCursor()
        internal
        view
        returns (ListBusinessPost)
    {
        return listBusinessPostCursor;
    }
}

database/business/post/ListBusinessPost..content:
// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12 <0.9.0;

import {Permission} from "../../../abstract/Permission.sol";

import {BusinessPost, BusinessPostStatus} from "../../../struct/business/post/BusinessPostStruct.sol";

contract ListBusinessPost is Permission {
    BusinessPost[] public list;

    constructor() Permission() {}

    event Add(BusinessPost item);

    event Remove(BusinessPost item);

    function add(BusinessPost memory item) public onlyApproved {
        item.id = list.length;
        list.push(item);
        emit Add(item);
    }

    function at(uint256 index)
        public
        view
        onlyApproved
        returns (BusinessPost memory)
    {
        return list[index];
    }

    // Setter
    function setBusinessPostStatus(uint256 index, BusinessPostStatus value)
        public
        onlyApproved
    {
        list[index].status = value;
    }
}

